import {useState, useEffect} from "react";


const Form = () => {
    const [kiosks, setKiosks] = useState(null)

    useEffect(() => {
        fetch('../data.json')
          .then(res => {
            if (!res.ok) {
                throw new Error(`Network response was not ok: ${res.status}`);
              }
            return res.json();  
          })
          .then(data => {
            console.log(data);
          }).catch(error => {
            console.error("Fetch error:", error);})
          }, [])

    return ( 
        <h1>{kiosks}</h1>
        
     );
}
 
export default Form;
